        public static void AddInitialData(this IServiceProvider serviceProvider)
        {
            using var scope = serviceProvider.CreateScope();

            var dbContext = scope.ServiceProvider.GetRequiredService<CinemaDbContext>();

            dbContext.Database.EnsureDeleted();
            dbContext.Database.EnsureCreated();

            dbContext.Users.ExecuteDelete();
            dbContext.Theaters.ExecuteDelete();
            dbContext.Sessions.ExecuteDelete();
            dbContext.Movies.ExecuteDelete();
            dbContext.Roles.ExecuteDelete();

            AddUsers(dbContext)
                .AddTheaters()
                .AddMovies()
                .AddSessions()
                .AddRoles();

            dbContext.SaveChanges();
        }

