        public static CinemaDbContext AddRoles(this CinemaDbContext dbContext)
        {
            var roles = new[]
            {
                new RoleEntity()
                {
                    Name = "Admin",
                    UserRoles = [
                        new UserRoleEntity
                        {
                            UserId = _users[0].Id
                        }
                    ],
                    Permissions = [
                        new PermissionEntity
                        {
                            AccessType = (int)CommonAccessType.Read,
                            ResourceType = (int)ResourceType.Movie
                        },
                        new PermissionEntity
                        {
                            AccessType = (int)(CommonAccessType.Read | CommonAccessType.Update),
                            ResourceType = (int)ResourceType.Theater
                        }
                    ]
                },
                new RoleEntity
                {
                    Name = "User"
                },
                new RoleEntity
                {
                    Name = "TheaterOwner"
                }
            };

            dbContext.Roles.AddRange(roles);
            dbContext.SaveChanges();
            return dbContext;
